    "narrative-report-bombay-hook-national-wildlife-refuge-january-december-1964",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Bombay
    Hook NWR outlines Refuge accomplishments during the 1964 calendar year. The report
    begins by summarizing the weather conditions, habitat conditions, water conditions,
    and food and cover conditions during the year. Wildlife- including migratory birds,
    upland game birds, big game animals, furbearers, predators, rodents, mammals, raptors,
    fish, and reptiles- is also covered. The Refuge development and maintenance section
    discusses physical developments, plantings, vegetation control, prescribed burning,
    and wildfires. Resource management is outlined; topics include haying and fur harvesting.
    A progress report on field investigations and applied research is also provided.
    The public relations section of the report describes recreational uses, Refuge visitors,
    Refuge participation, hunting, and safety. Items of interest, N-R forms, photographs,
    and newspaper articles are attached.",nt"license_title": "License Not Specified",nt"extras":
